def both_books(book1, book2):
    """
    this function looks for the most common words that pop up in both texts
    and prints the top 10 words that show up in both.

    >>> meh = both_books(most1, most2)
    >>> print(meh[:10])
    ['Alice', 'little', 'about', 'would', 'could', 'thought', 'quite', 'their', 'began', 'looked']
    """

    words_in_both_books = []
    for words in book1:
        if words in book2:
                words_in_both_books.append(words)
    return words_in_both_books


